import Login from '../Components/Login'
import { AuthContext } from '../Components/context/AuthContext'

export default function RoutesProtect({children}) {
    const {token} = useContext(AuthContext)
  return (
    <>
     {
        token ? children : <Login />
    }
    </>
   
  )
}
